import React, { useState, useEffect } from "react";

export default function Artist({ artists }) {
  return (
    <div>
      <ul className="artists-list">
        {artists &&
          artists.map((el) => {
            <li>{el[0].name}</li>;
          })}
      </ul>
    </div>
  );
}
